import Player from "./Player"

function PlayerList({ players }) {
    return (
        <div>
            <h1>{player.age}</h1>
            {players.map((player) => {
                <div>

                <Player
                    key={player.id}
                    first_name = {player.first_name}
                    last_name = {player.last_name}
                    age = {player.age}
                    position = {player.position}
                />
                </div>
            })}
        </div>
    )
}

export default PlayerList;
